import React, { useContext, useEffect, useState } from "react";
import { Context } from "../hooks/context.js";
import axios from "axios";
import { Card, Button } from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.min.css';

const Principal = () => {
  const [context, setContext] = useContext(Context);
  const [eventos, setEventos] = useState([]);
  const user = context;
  useEffect(() => {
    eventosUsuario();
  }, []);
  const eventosUsuario = () => {
    axios.get("/usuarios/" + user.id + "/eventos").then((response) => {
      //Info en data
      setEventos(response.data);
    });
  };
  /*
     "categoria": "Cat1",
    "creador_id": 6,
    "direccion": "Universidad de los Andes",
    "fechaFin": "2018-06-29",
    "fechaInicio": "2018-06-29",
    "id": 2,
    "lugar": "ML-515",
    "nombre": "Clase remota para el 4",
    "tipo": "Virtual"
  */
  return (
    <div>
      {eventos.map((evento, index) => (
        <div key={index + 1}>
          <Card style={{ width: "18rem" }}>
            <Card.Body>
              <Card.Title>{evento.nombre}</Card.Title>
              <Card.Subtitle className="mb-2 text-muted">
                {evento.direccion}
              </Card.Subtitle>
              <Card.Text>
           <p>Empieza: {evento.fechaInicio}</p>
           <p>Termina: {evento.fechaFin}</p>

              </Card.Text>
              <Card.Link href="#">Card Link</Card.Link>
              <Card.Link href="#">Another Link</Card.Link>
            </Card.Body>
          </Card>
        </div>
      ))}
    </div>
  );
};
export default Principal;
